import React, { useEffect } from 'react'
import axios from 'axios';

function LandingPage() {

  //LandingPage() 들어오자마자 실행한다
  useEffect(() => {
    axios.get('/api/hello')
    .then(response => console.log(response.data))
  }, [])

  return (
    <div>
      LandingPage
      <button type="button" id="tradingStartBtn" aria-hidden="true" alt="자동매매 시작하기">
        <img src="./tradingStartBtn.svg" alt="매매 시작 버튼"> </img>
      </button>
    </div>
  )
}

export default LandingPage
